column8:
■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">太陽光のギラツキを抑え、目に優しい偏光レンズを採用。着脱不要のハネ上げタイプなので作業がスムーズに！両サイドにレンズが入っているので、広い視野を確保できます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">約縦4.7ラ横15.5ラ高さ16cm<br>個装：約6ラ18ラ8.5cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約33g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">カラー</font></td><td align="left"><font color="#333333" size="-1">ブラウン</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">レンズ：プラスチック<br> レンズわく：プラスチック<br>テンプル：プラスチック</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">携帯用収納ケース</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">台湾</font></td></tr></table><!--ab--><style type="text/css">
/*買い物かごに入れるボタン*/
